import React, { Component } from 'react';
import '../App.css';
import { SidebarData } from './sidebar_data'


class SideBar extends Component {
    state = {  } 
    render() { 
        return (
            <React.Fragment key='left'>
                <ul>
                    <div className='Sidebar'>
                        {SidebarData.map((val, key) => {return(
                            <li key={key}>
                                <div>{val.icon}</div>
                                <div>{val.title}</div>
                            </li>)})
                        }
                    </div>
                </ul>

            </React.Fragment>
        )
    }
}

export default SideBar;
